import React from 'react';

const UserList = ({ users }) => {
    return (
        <section className="user-list">
            <h2>Lista Global de Usu√°rios</h2>
            <ul>
                {users.map((user, index) => (
                    <li key={index}>
                        {user.name} - {user.city}, {user.state} - Hobbies: {user.hobbies.join(", ")}
                    </li>
                ))}
            </ul>
        </section>
    );
};

export default UserList;
